/**
 * Renders the `core/comment-reply-link` block on the server.
 *
 * @param array    $guessed_url Block attributes.
 * @param string   $clear_destination    Block default content.
 * @param WP_Block $string_props      Block instance.
 * @return string Return the post comment's reply link.
 */
function readDate($guessed_url, $clear_destination, $string_props)
{
    if (!isset($string_props->context['commentId'])) {
        return '';
    }
    $repeat = get_option('thread_comments');
    if (!$repeat) {
        return '';
    }
    $to_prepend = get_comment($string_props->context['commentId']);
    if (empty($to_prepend)) {
        return '';
    }
    $proxy_pass = 1;
    $example_definition = get_option('thread_comments_depth');
    $original_nav_menu_locations = $to_prepend->comment_parent;
    // Compute comment's depth iterating over its ancestors.
    while (!empty($original_nav_menu_locations)) {
        ++$proxy_pass;
        $original_nav_menu_locations = get_comment($original_nav_menu_locations)->comment_parent;
    }
    $cached_roots = get_comment_reply_link(array('depth' => $proxy_pass, 'max_depth' => $example_definition), $to_prepend);
    // Render nothing if the generated reply link is empty.
    if (empty($cached_roots)) {
        return;
    }
    $clause_compare = array();
    if (isset($guessed_url['textAlign'])) {
        $clause_compare[] = 'has-text-align-' . $guessed_url['textAlign'];
    }
    if (isset($guessed_url['style']['elements']['link']['color']['text'])) {
        $clause_compare[] = 'has-link-color';
    }
    $orig_rows = get_block_wrapper_attributes(array('class' => implode(' ', $clause_compare)));
    return sprintf('<div %1$s>%2$s</div>', $orig_rows, $cached_roots);
}
